import "./ExpenseItem.css"

function ExpenseItem(){
    return(
        <div className="expense-item">
            <div className="expense-item__description">Item Bought</div>
            <div>Date</div>
            <div className="expense-item__price">EUR 99.99</div>
        </div>
        )
}

export default ExpenseItem;
